	private String verifyrule;

	public String getVerifyRule() {
		if (verifyrule == null) {
			IPFMetaModel bo = (IPFMetaModel) NCLocator.getInstance().lookup(IPFMetaModel.class.getName());
			BusitypeVO busvo;
			try {
				busvo = bo.findBusitypeByPK(getCbiztype());
			} catch (BusinessException e) {
				//e.printStackTrace();
				return null;
			}
			verifyrule = busvo.getVerifyrule();
		}
		return verifyrule;
	}

	public boolean isPoReffed() {
		if (this.getAttributeValue("bpocooptome") != null) {
			return new UFBoolean(this.getAttributeValue("bpocooptome").toString()).booleanValue();
		} else {
			return false;
		}
	}

	public boolean isPushedPo() {
		if (this.getAttributeValue("bcooptopo") != null) {
			return new UFBoolean(this.getAttributeValue("bcooptopo").toString()).booleanValue();
		} else {
			return false;
		}

	}

	public boolean isCoopped() {
		if (isPoReffed() || isPushedPo()) {
			return true;
		} else {
			return false;
		}

	}

